import axios from "axios";
import { useParams } from "react-router-dom";

export async function fetchData() {
  const {topic}=useParams
    try {
      const response = await axios.get(`http://127.0.0.1:8000/mcq/`);
      return response.data;
    } catch (error) {
        console.log(error);
    }
  }
